import getConfigCelo from './networkConfig'
const Web3 = require('web3');
const celoConfig = getConfigCelo('testnet');

export async function initContractCelo() {

  if (typeof window.ethereum !== "undefined") {
    window.provider = window.ethereum;
    if (window.ethereum.providers?.length) {
      window.ethereum.providers.forEach(async (p) => {
        if (p.isMetaMask) window.provider = p;
      });
    }
  }

  window.accountIdCelo = "";
  if (typeof window.provider !== "undefined") {
    if (window.provider && window.provider.isMetaMask) {

      try {
        if (typeof window.provider !== "undefined") {
          const chainId = await window.provider.request({ method: 'eth_chainId' });
          if (chainId === celoConfig.chainId) {
            const accounts = await window.provider.request({ method: 'eth_accounts' });
            const account = accounts[0];
            window.accountIdCelo = account;
            window.web3 = new Web3(window.provider);
            window.contractEKOX = new window.web3.eth.Contract(celoConfig.ABIcontract, Web3.utils.toChecksumAddress(celoConfig.contractEKOX));
          }
        }
      } catch (error) {
        console.log(error);
      }

    } else {
    }
  }

  setListener();

}

export async function login() {

  if (typeof window.ethereum !== "undefined") {
    window.provider = window.ethereum;
    if (window.ethereum.providers?.length) {
      window.ethereum.providers.forEach(async (p) => {
        if (p.isMetaMask) window.provider = p;
      });
    }

    let changed = null;
    const chainId = await window.provider.request({ method: 'eth_chainId' });
    if (chainId !== celoConfig.chainId) {
      try {
        await window.provider.request({ method: 'wallet_switchEthereumChain', params: [{ chainId: celoConfig.chainId }] });
      } catch (error) {
        changed = 0;
        if (error.code == 4902) {
          try {
            let paramChain = {
              chainId: celoConfig.chainId,
              chainName: celoConfig.chainName,
              rpcUrls: celoConfig.rpcUrls,
              nativeCurrency: celoConfig.nativeCurrency,
              blockExplorerUrls: celoConfig.blockExplorerUrls
            }      
            changed = await window.provider.request({ method: 'wallet_addEthereumChain', params: [paramChain] });
          } catch (error_2) {
            console.log("There was an error adding the chain");
            console.log(error_2);
          }
        }
      }
    }

    if (changed == null) {
      const accounts = await window.provider.request({ method: 'eth_requestAccounts' });
      const account = accounts[0];
      window.accountIdCelo = account;
      console.log(window.accountIdCelo);
      window.location.replace(window.location.origin + window.location.pathname);
    }

  } else {
    window.open("https://metamask.io/download/","_self");
  }

}

//Returns True if Metamask is logged in, False otherwise
export async function metamaskIsSignedIn() {

  try {

    if (typeof window.ethereum !== "undefined") {
      window.provider = window.ethereum;
      if (window.ethereum.providers?.length) {
        window.ethereum.providers.forEach(async (p) => {
          if (p.isMetaMask) window.provider = p;
        });
      }
    }

    if (typeof window.provider !== "undefined") {
      const accounts = await window.provider.request({ method: 'eth_accounts' });
      const chainId = await window.provider.request({ method: 'eth_chainId' });
      if (accounts && accounts.length > 0 && chainId === celoConfig.chainId) {
        window.accountIdcelo = accounts[0];
        return true;
      }
    }
  } catch (error) {
    console.log(error);
  }
  return false;

}

async function setListener() {
  try {
    if (typeof window.ethereum !== "undefined") {
      window.provider = window.ethereum;
      if (window.ethereum.providers?.length) {
        window.ethereum.providers.forEach(async (p) => {
          if (p.isMetaMask) window.provider = p;
        });
      }
    }
    if (typeof window.provider !== "undefined") {
      window.provider.on('accountsChanged', async () => {
        window.location.replace(window.location.origin + window.location.pathname);
      });

      window.provider.on('chainChanged', function (networkId) {
        window.location.replace(window.location.origin + window.location.pathname);
      });
    }
  } catch (error) {
  }  
}

export async function approveAccountToSpentEKOX( account, amount ) {
  let intAmount = BigInt( amount * (10 ** 18) );
  try {
    let result = await window.contractCBS.methods.approve( account, intAmount ).send({ from: window.provider.selectedAddress, gas: 3000000 });
  } catch {
    console.log( "User denied transaction" );
  }
}

export async function checkEKOXBalance( account ) {
  console.log(account);
  return await window.contractEKOX.methods.balanceOf( account ).call({});
}

export async function getCostList( account ) {
  console.log(account);
  return await window.contractEKOX.methods.getCostList( account ).call({});
}

export async function getCoordinates( account, id ) {
  console.log(account);
  return await window.contractEKOX.methods.getCoordinates( account, id ).call({});
}

export async function isFirstTime( account ) {
  console.log(account);
  return await window.contractEKOX.methods.isFirstTime( account ).call({});
}

export async function claimYield( yieldCost ) {
  let intAmount = BigInt( Number( ( yieldCost * ( 10 ** 18 ) ).toFixed(0) ) );
  return await window.contractEKOX.methods.claimYield( intAmount ).send({ from: window.provider.selectedAddress, gas: 3000000 });
}

export async function getTimeList( account ) {
  console.log(account);
  return await window.contractEKOX.methods.getTimeList( account ).call({});
}

export async function transferAmountEKOXTo( account, amount ) {
  let intAmount = BigInt( amount * ( 10 ** 18 ) );
  try {
    let result = await window.contractEKOX.methods.transfer( account, intAmount ).send({ from: window.provider.selectedAddress, gas: 3000000 });
  } catch {
    console.log( "User denied transaction" );
  }
}

export async function claimStartingTokens() {
  try {
    let result = await window.contractEKOX.methods.claimStartingTokens().send({ from: window.provider.selectedAddress, gas: 3000000 });
  } catch {
    console.log( "User denied transaction" );
  }
}

export async function buyLand(coordList, totalCost) {
  let intAmount = BigInt( totalCost * ( 10 ** 18 ) );
  try {
    let result = await window.contractEKOX.methods.buyLand( coordList[coordList.length-1], intAmount ).send({ from: window.provider.selectedAddress, gas: 3000000 });
  } catch {
    console.log( "User denied transaction or insufficient balance" );
  }
}
